import { createApp } from 'vue';
import { createRouter, createWebHashHistory } from 'vue-router';

import CharacterGeneratorPage from './components/CharacterGenerators/CharacterGeneratorPage';

const routes = [
  { path: '/', component: CharacterGeneratorPage }
];

const router = createRouter({
  history: createWebHashHistory(),
  routes
});

const app = createApp({});

app.use(router);
app.mount('#app');
